import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

const Step2 = () => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    const fetchVehicles = async () => {
      try {
        // Retrieve step2Data from localStorage
        const step2Data = JSON.parse(localStorage.getItem('step2Data'));

        // Make API call to get available vehicles using the stored data
        const response = await axios.get(`https://calm-retreat-90846-cd036e8a822e.herokuapp.com/https://api.rentsyst.com/v2/booking/search`, {
          params: {
            pickupDateTime: step2Data.pickupDateTime,
            returnDateTime: step2Data.returnDateTime,
            selectedLocation: step2Data.selectedLocation,
            customAddress: step2Data.customAddress
          },
          headers: {
            Authorization: `Bearer ${step2Data.token}` // Include token in Authorization header
          }
        });

        // Set vehicles state with response data
        setVehicles(response.data);
      } catch (error) {
        console.error('Error fetching vehicles:', error);
        setError('Failed to fetch vehicles');
      } finally {
        setLoading(false);
      }
    };

    // Call fetchVehicles function
    fetchVehicles();
  }, []);

  return (
    <div className="step2">
      {/* Your JSX */}
    </div>
  );
};

export default Step2;
